var fromPlayerInZeppelinPosition = new Vector3(-14279.72, 571.4982, 6.086659, "None");// Position where the player waits in the Zeppelin/Ship (from)
// To
var toZeppelinWaitPosition = new Vector3(-1005.614, -3841.648, 0, "None"); // Position where Zeppelin/Ship waits players (to)
var toPlayerLeavePosition =  new Vector3(-997.475, -3830.006, 5.56524, "None"); // Position to go out the Zeppelin/Ship (to)
// var toPlayerLeaveBoat = new Vector3(-14279.72, 571.4982, 6.086659, "None"); // put player at end of boat (to)


